    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"></script>

    <script>

    
    var testData='{"Range":125}';
    //Pixels/MilliMeters
    // 800px - 160pxpx / 215mm - 65mm  
    var contant_pxmm = 640/150;
    //Keep old range in order to provide tolerance
    var oldRange = 0;
    //Tolerance
    var tolerance = 5;

    //End MilliMeter
    var endMM = 215;
    //Start MilliMeter
    var startMM = 65;
    //Start Pixel
    var startPixel = 160;

    //Refresh MilliSeconds
    var refrestMillis = 250;

    //Is it first start
    var isStart = true;

    var lastUpdateTime = new Date().getTime();

    $(document).ready(function(){
        $("#test_button").click(function(){
            onData(testData);
        });
    });
    
    function onData(data){
    	// Do not run too often
    	var currentMillis = new Date().getTime();
    	if(lastUpdateTime + refrestMillis > currentMillis){
    		return;
    	}

    	lastUpdateTime = currentMillis;

        data=JSON.parse(data);
        
        //Out of range
        if (data.Range > endMM) {
          $("#car").hide();
          return;
        }else if(data.Range == 0){
        	// 0 = Infinite
        	$("#car").css("visibility", "hidden");
        	isStart = true;
			return;
        }else{
          //In range
          $("#car").show();
        }

        if (data.Range > (oldRange + tolerance) || data.Range < (oldRange - tolerance)) {

          oldRange = data.Range;
          var px = (((data.Range - startMM) * contant_pxmm) + startPixel);

          if (isStart) {
			$("#car").css("margin-top", px + "px");
			$("#car").css("visibility", "visible");
			isStart = false;
          }else{
          	$("#car").animate({marginTop: px + 'px'},200,'linear');
          }
        }
    }

    </script>
